import React, { useState } from 'react';

const Fixture = () => {
  const [fixtures] = useState([
    {
      id: 1,
      date: '2022-05-01',
      time: '14:30',
      homeTeam: 'Team A',
      awayTeam: 'Team B',
      venue: 'Stadium X',
    },
    {
      id: 2,
      date: '2022-05-08',
      time: '15:00',
      homeTeam: 'Team C',
      awayTeam: 'Team D',
      venue: 'Stadium Y',
    },
    // add more fixtures here
  ]);

  return (
    <div>
      <h2>Fixtures</h2>
      <table>
        <thead>
          <tr>
            <th>Date</th>
            <th>Time</th>
            <th>Home Team</th>
            <th>Away Team</th>
            <th>Venue</th>
          </tr>
        </thead>
        <tbody>
          {fixtures.map((fixture) => (
            <tr key={fixture.id}>
              <td>{fixture.date}</td>
              <td>{fixture.time}</td>
              <td>{fixture.homeTeam}</td>
              <td>{fixture.awayTeam}</td>
              <td>{fixture.venue}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Fixture;
